measurements.description:
Two hundred ninety round flowers and 156 buds on 29 up to 25.5-cm inflorescences;
 born on a 48-cm wide by 21-cm tall plant in a 20-cm plastic pot, grown in fir bark and coir;
 sepals and petals widely elliptic, peach overlaid rose, dark rose proximally;
 lip saccate, cream, light orange distally, side lobes dark rose;
 column white overlaid orange, anther cap light yellow; substance firm; texture crystalline.
